export class Detail {
    constructor(lesson_name, teacher_name, day_of_week, time, number_of_credits, level, hit_level, teacher_review, attendance, adequacy, test_level, task_level, middle_test_level, carry, total) {
        this.lesson_name = lesson_name;
        this.teacher_name = teacher_name;
        this.day_of_week = day_of_week;
        this.time = time;
        this.number_of_credits = number_of_credits;
        this.level = level;
        this.hit_level = hit_level;
        this.teacher_review = teacher_review;
        this.attendance = attendance;
        this.adequacy = adequacy;
        this.test_level = test_level;
        this.task_level = task_level;
        this.middle_test_level = middle_test_level;
        this.carry = carry;
        this.total = total;
    }
}
